double
erfcx(double x)
{
    if (x > 0.0) {
        if (x > 50.0) {
            // Use the truncated continued fraction expansion.
            // See Abramowitz & Stegun 7.1.14 (combined with the definition in 7.1.2).
            // ispi = 1/sqrt(pi)
            const double ispi = 0.5641895835477562869480794515607725858;
            return ispi / (x + 0.5 / (x + 1.0 / (x + 1.5 / (x + 2.0/x))));
        }
        else {
            return erfcx_y100(400.0/(4.0 + x));
        }
    }
    else {
       // x <= 0
       if (x < -26.628735713751485) {
           return std::numeric_limits<double>::infinity();
       } else {
           // Use the identity erfcx(x) = 2*exp(x**2) - erfcx(-x)
           return 2.0*std::exp(x*x) - erfcx_y100(400.0/(4.0 - x));
       }
    }
}



