long double
erfcx(long double x)
{
    if (x > 0.0L) {
        if (x > 100.0L) {
            // Use the truncated continued fraction expansion.
            // See Abramowitz & Stegun 7.1.14 (combined with the definition in 7.1.2).
            // ispi = 1/sqrt(pi)
            const long double ispi = 0.5641895835477562869480794515607725858L;
            return ispi / (x + 0.5L / (x + 1.0L / (x + 1.5L / (x + 2.0L/x))));
        }
        else {
            return erfcx_y100(400.0L/(4.0L + x));
        }
    }
    else {
       // x <= 0
       if (x < -106.56373801210984173L) {
           return std::numeric_limits<long double>::infinity();
       } else {
           // Use the identity erfcx(x) = 2*exp(x**2) - erfcx(-x)
           return 2.0L*std::exp(x*x) - erfcx_y100(400.0L/(4.0L - x));
       }
    }
}

